import Timer from './Timer';
import styled from 'styled-components';

const Container = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 100vh;
`;

const App = () => (
    <div id="app">
        <Container>
            <Timer></Timer>
        </Container>
    </div>
);

export default App;
